import { useState } from 'react';
import Style from "./HomeMain.module.css";
import Members from "../../footer/footer";
import Logo from "../../logo/Logo";
import SearchBar from "./searchBar";

const Home = ({changeState}) => {
  //0: 새 글 // 1: 채팅 // 2: 알림 // 3: 친구 // 4: 설정
  const [rightBookState, setRightBookState] = useState("3");

  //태그 클릭 hander
  const newPostClickHandler = () =>{
    setRightBookState("0");
  }
  const chatClickHandler = () =>{
    setRightBookState("1");
  }
  const noticeClickHandler = () =>{
    setRightBookState("2");
  }
  const friendClickHandler = () =>{
    setRightBookState("3");
  }
  const settingClickHandler = () =>{
    setRightBookState("4");
  }
  return(
    <div className={Style.pageCover}>
      <div />
      <div className={Style.mainPage}>
        <div className={Style.bookCover}>
          <div className={Style.leftBook}>
            <div className={Style.splitBookCover}>
              <div className={Style.leftHeader}>
                <div className={Style.leftHeaderCover}>
                    <Logo />
                    <div />
                    <SearchBar />
                </div>
              </div>
              <div className={Style.leftMain}>

              </div>
            </div>
          </div>
          <div className={Style.rightBook}>
            <div className={Style.splitBookCover}>
              <div className={Style.rightHeader}>
                <div className={Style.rightHeaderCover}>
                  <div className={Style.tag}>
                    {
                      rightBookState === "0" ?
                      <div className={Style.activeTag}>
                        <p>글</p>
                      </div>
                      :
                      <div className={Style.inactiveTag}>
                        <p>글</p>
                      </div>
                    }
                  </div>
                  <div className={Style.tag}>
                    {
                      rightBookState === "1" ?
                      <div className={Style.activeTag}>
                        <p>챗</p>
                      </div>
                      :
                      <div className={Style.inactiveTag}>
                        <p>챗</p>
                      </div>
                    }
                  </div>
                  <div className={Style.tag}>
                    {
                      rightBookState === "2" ?
                      <div className={Style.activeTag}>
                        <p>알</p>
                      </div>
                      :
                      <div className={Style.inactiveTag}>
                        <p>알</p>
                      </div>
                    }
                  </div>
                  <div className={Style.tag}>
                    {
                      rightBookState === "3" ?
                      <div className={Style.activeTag}>
                        <p>친</p>
                      </div>
                      :
                      <div className={Style.inactiveTag}>
                        <p>친</p>
                      </div>
                    }
                  </div>
                  <div className={Style.tag}>
                    {
                      rightBookState = "4" ?
                      <div className={Style.activeTag}>
                        <p>설</p>
                      </div>
                      :
                      <div className={Style.inactiveTag}>
                        <p>설</p>
                      </div>
                    }
                  </div>
                </div>
              </div>
            <div className={Style.rightMain}>

              </div>
            </div>
          </div>
        </div>
      </div>
      <div />
      <Members />
    </div>
  );
}
  
export default Home;
